import React from 'react';
import { Link } from 'react-router-dom';

const DynamicTile = props => {
  const data = props.data;
  let totalCompleted = 0;
  data.forEach(task => {
    if (task.completed) {
      totalCompleted++;
    }
  });
  let percentage = Math.round((totalCompleted / data.length) * 100);
  return (
    <div className="col-2">
      <Link to={'/cat/' + props.to}>
        <div className="tile">
          <div className={'bar b-warning'}></div>
          <div className="text">
            <div>{props.top}</div>
            <div className="tile-icon">
              <i className={props.icon}></i>
            </div>
            <div>
              {totalCompleted}/{props.data.length} Completed - {percentage}
            </div>
          </div>
        </div>
      </Link>
    </div>
  );
};

export default DynamicTile;
